package com.vtsb.hipago.data.datasource.memory

import com.google.common.collect.BiMap
import com.vtsb.hipago.domain.entity.TagType
import org.json.JSONObject
import java.util.*
import javax.inject.Inject
import javax.inject.Named


class LocalizationGetter @Inject constructor(
    @Named("stringTypeBiMap") private val stringTypeBiMap: BiMap<String, TagType>
) {

    fun get(language: String): Map<TagType, Map<String, String>> {

        val jsonObject = JSONObject(when(language) {
            "korean" -> getKorean()
            else -> ""
        })

        val map: MutableMap<TagType, MutableMap<String, String>> = EnumMap(TagType::class.java)

        for (tagTypeStr in jsonObject.keys()) {
            val tagType = stringTypeBiMap[tagTypeStr]!!
            val values = jsonObject.getJSONObject(tagTypeStr)

            val typeMap: MutableMap<String, String> = HashMap()
            for (key in values.keys()) {
                typeMap[key] = values.getString(key)
            }
            map[tagType] = typeMap
        }

        return map
    }

